      '<p><p>Unlimited use on any Diamond bus<small><strong>*</strong></small> within the West Midlands Worcestershire or Wyvern area and service numbers 16 & 50 operated by Diamond.</p><p><cite><small>*Excludes school services, Park & Ride service, Lichfield services and Atherstone, Warwickshire services. Please bear in mind that not all services operate every day.</cite></small></p></p><p><p><strong>New to swift?</strong></p><p> Purchase online, at a <a href="https://www.networkwestmidlands.com/get-in-touch/travel-centres">Travel Centre</a> or <a href="https://www.networkwestmidlands.com/swift/topping-up/#kiosk">Kiosk</a> and your ticket will come loaded onto a swift photocard, which can be reused for future ticket purchases or renewals. </p><p><strong>Existing swift photocard holder?</strong></p>\nIf you already hold a Swift photocard, you can use our <a href="https://www.networkwestmidlands.com/swift/topping-up/">Click and Collect</a> service. Just log in, or create an <a href="https://my.swiftcard.org.uk/ssp/swift/ng-app.jsp?u=5ba060ce-a05d-44db-96c0-2a35ea7cc63a#/mainEntrance">account</a> to make your purchase and collect your ticket onto your card using the <a href="https://www.networkwestmidlands.com/swift/topping-up/#appSwift">Swift Collector app</a>, or at over 100 on-street Collectors.</p><p>Also available to purchase at <a href="https://www.payzone.co.uk/consumers/">Payzone Agents</a>.</p></p><p><p><strong>Save on days out</strong></p><p>Entitles ticket holder to discounts at local attractions. Just show your ticket or Swift card together with one of our vouchers. Download <a href="https://www.networkwestmidlands.com/offers/discount-vouchers/ ">here</a>.</p></p><p>Once you have your card you just keep renewing your product through your Swift account.  <a href="https://my.swiftcard.org.uk/ssp/swift/ng-app.jsp#/mainEntrance"> Log in </a>, , select the card you\'d like to top-up tell us what you\'d like to add to your card, then click to checkout.\nThen all you need to do is collect. Use the <a  href="https://play.google.com/store/apps/details?id=com.unicard.swift&hl=en_GB"> Swift Card app </a>, or at over 100 on-street <a> href=" https://www.networkwestmidlands.com/swift/topping-up/#swift-collector "> Swift Collectors </a>, to load your ticket to your card.</p>\n\n<p><cite><small>*Some service exceptions may apply (closed door services) - See individual service pages on our website for information.</a>.</cite></small></p>',
